import express from 'express';
import morgan from 'morgan';
import cors from 'cors';
import path from 'path';

//Antes de instalar Babel
/*const express = require('express');
const morgan = require('morgan');
const cors = require('cors');
// Para acceder al directorio actual
const path = require('path');*/
const app = express();

// Conexión base de datos
const mongoose = require('mongoose');
//const uri = 'mongodb://localhost:27017/pruebanotas';
const uri = 'mongodb+srv://UserTest:BasesDeTrabajo01@cluster0.eba8w.mongodb.net/myFirstDatabase?retryWrites=true&w=majority';
//Cambio
/*const options = {useNewUrlParser: true, useCreateIndex: true};*/
const options = {useNewUrlParser: true, useUnifiedTopology: true};

// Or using promises
mongoose.connect(uri, options).then(
    () => {  /** ready to use. The `mongoose.connect()` promise resolves to mongoose instance. */
        console.log('Conectado a DB')
    },
    err => {  /** handle initial connection error */
        console.log(err)
    }
);

//MIDDLEWARE
app.use(morgan('tiny'));
app.use(cors());
app.use(express.json());
//application/x-www-form-urlencoded
app.use(express.urlencoded({ extended: true }))
//Se implementa luego con el history
/*app.use(express.static(path.join(__dirname, 'public')));*/

//RUTA
//Se usa para verificar que funciona 
/*app.get('/', function (req, res) {
    res.send('Hello World!');
});*/
app.use('/api', require('./routes/nota'));

// Middleware para Vue.js router modo history
const history = require('connect-history-api-fallback');
app.use(history());
app.use(express.static(path.join(__dirname, 'public')));

//PUERTO FIJO
/*app.listen(3000, function () {
    console.log('Example app listening on port 3000!')
});*/

//PUERTO AUTOMATICAMENTE
app.set('puerto', process.env.PORT || 3000);
app.listen(app.get('puerto'), function () {
    console.log('Example app listening on port'+ app.get('puerto'));
});

